feature psts {
# We need to swap here because if we ligate i.e. ka|PNS|iVowel to ka_iVowel|PNS and then
# ka_iVowel later becomes ka_iVowel.undera, we will discover that we cannot anchor the PNS
# onto it. But if we do the exact same with ka|iVowel|PNS -> ka_iVowel|PNS -> ka_iVowel.undera|PNS
# all is well. This is one of those completely undocumented rules that make no sense and you
# just have to know them; search the Harfbuzz sources(!) for "trickiest part of OpenType"
# for more details.
lookup VowelAboveMarkSwaps {
	sub prefixedNasalSign-divesakuru' lookup toIVowel iVowel-divesakuru' lookup toPrefixedNasalSign;
	sub prefixedNasalSign-divesakuru.alt' lookup toIVowel iVowel-divesakuru' lookup toPrefixedNasalSign.alt;
	sub prefixedNasalSign-divesakuru' lookup toAAVowel aaVowel-divesakuru' lookup toPrefixedNasalSign;
	sub prefixedNasalSign-divesakuru.alt' lookup toAAVowel aaVowel-divesakuru' lookup toPrefixedNasalSign.alt;
	sub prefixedNasalSign-divesakuru' lookup toIIVowel iiVowel-divesakuru' lookup toPrefixedNasalSign;
	sub prefixedNasalSign-divesakuru.alt' lookup toIIVowel iiVowel-divesakuru' lookup toPrefixedNasalSign.alt;
	sub prefixedNasalSign-divesakuru' lookup toUVowel uVowel-divesakuru' lookup toPrefixedNasalSign;
	sub prefixedNasalSign-divesakuru.alt' lookup toUVowel uVowel-divesakuru' lookup toPrefixedNasalSign.alt;
	sub prefixedNasalSign-divesakuru' lookup toUUVowel uuVowel-divesakuru' lookup toPrefixedNasalSign;
	sub prefixedNasalSign-divesakuru.alt' lookup toUUVowel uuVowel-divesakuru' lookup toPrefixedNasalSign.alt;
	sub prefixedNasalSign-divesakuru' lookup toOOVowel ooVowel-divesakuru' lookup toPrefixedNasalSign;
	sub prefixedNasalSign-divesakuru.alt' lookup toOOVowel ooVowel-divesakuru' lookup toPrefixedNasalSign.alt;
	sub prefixedNasalSign-divesakuru' lookup toHalanta halanta-divesakuru' lookup toPrefixedNasalSign;
	sub prefixedNasalSign-divesakuru.alt' lookup toHalanta halanta-divesakuru' lookup toPrefixedNasalSign.alt;
	sub prefixedNasalSign-divesakuru' lookup toMedYa ya-divesakuru.medi' lookup toPrefixedNasalSign;
	sub prefixedNasalSign-divesakuru.alt' lookup toMedYa ya-divesakuru.medi' lookup toPrefixedNasalSign.alt;

} VowelAboveMarkSwaps;

